const DetailsPage = () => {
    const [product, setProduct] = useState()
    const { id } = useParams();

    useEffect(() => {
        axios
            .get(`http://localhost:8000/api/products/${id}`)
    }, [])
    return(
        <div>
            <h2>Info</h2>
        </div>
    )
}

export default DetailsPage;
